import { createApp } from 'vue'
import App from './App.vue'
import router from './router'
import ElementPlus from 'element-plus'
import 'element-plus/dist/index.css'
import * as Icons from '@element-plus/icons-vue'
import axios from 'axios'

// 添加这段代码来抑制ResizeObserver警告
const debounce = (fn, delay) => {
  let timer = null
  return function() {
    let context = this
    let args = arguments
    clearTimeout(timer)
    timer = setTimeout(function() {
      fn.apply(context, args)
    }, delay)
  }
}

// 抑制ResizeObserver警告
const originalError = console.error
console.error = (...args) => {
  if (args[0]?.includes?.('ResizeObserver') || 
      args[0]?.message?.includes?.('ResizeObserver')) {
    return
  }
  originalError.apply(console, args)
}

const app = createApp(App)
app.use(router)
app.use(ElementPlus)

// 注册图标
Object.keys(Icons).forEach(key => {
  app.component(key, Icons[key])
})

// 医保局用户令牌
const adminToken = "eyJhbGciOiJIUzI1NiJ9.eyJzdWIiOiJhZG1pbiIsInJvbGUiOiJJTlNVUkFOQ0VfQlVSRUFVIiwiaWF0IjoxNzEzNjg0MjY0LCJleHAiOjE3MTYyNzYyNjR9.KoGW6HBQd46gwqoSidVdO2vPJ-d-fBbf_5oAE9e5t9A";

// 医院用户令牌
const hospitalToken = "eyJhbGciOiJIUzI1NiJ9.eyJzdWIiOiJob3NwaXRhbDEiLCJyb2xlIjoiSE9TUElUQUwiLCJob3NwaXRhbENvZGUiOiJIMTAwMDEiLCJpYXQiOjE3MTM2ODQyNjQsImV4cCI6MTcxNjI3NjI2NH0.3LnIYTtJ-dHcv0M6-FVNO2lCY_TQh4D7-U2HPG1MZg0";

// 配置请求拦截器 - 自动添加认证头
axios.interceptors.request.use(config => {
  // 使用医保局用户令牌 (或取消注释使用医院用户令牌)
  config.headers.Authorization = `Bearer ${adminToken}`;
  // config.headers.Authorization = `Bearer ${hospitalToken}`;
  
  return config;
});

app.mount('#app')

// eslint-disable-next-line no-unused-vars
const unusedVar = 'test'
